INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("春咲 ひより", "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1, 0, 1001, 0, 0, 0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", "お！\nあそこに困ってそうな人発見！", 2, 0, 1.4, 1, 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("草野 優衣", "わ、わたし、\nなに言ってるんだろ\nあはは…", 1, 0, 1002, 0, 0, 0, "みんなみたいに\nわたしも強くならなきゃ", "大切な人を\n守れるようになりたい…って", 2, 0, 1.4, 1, 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("士条 怜", "少しは磨かれると思いますよ。", 1, 0, 1003, 0, 0, 0, "フェンシングを始めてみては？", "キミに必要な集中力と感性が", 2, 0, 1.4, 1, 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("穂高 みそぎ", "みそぎはねぇ、\nかくれんぼやりたい！", 1, 0, 1004, 0, 0, 0, "ねぇ、にいちゃん！", "今日はなにして遊ぶ？", 2, 0, 1.5, 1, 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("風宮 あかり", "私といっしょに…\nいかない？", 1, 0, 1006, 0, 0, 0, "風宮あかりです", "ねぇ…", 2, 0, 1.4, 1, 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("出雲 宮子", "食べ物の恨みは怖いのー", 1, 0, 1007, 0, 0, 0, "出雲宮子なのー", "プリンたべたいのー", 2, 0, 1.5, 1, 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("虹村 雪", "いいよ。\n見られることは運命さ…", 1, 0, 1008, 0, 0, 0, "ボクは虹村雪。", "キミもボクの美貌に\n吸い寄せられたんだね。", 2, 0, 1.4, 1, 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("柊杏奈", "人呼んで「疾風の冥姫」!!", 1, 0, 1009, 0, 0, 0, "フッ…聞いて後悔するがいい！", "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 2, 0, 1.4, 1, 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("姫宮 真歩", "ほんまおおきにやわ～♪", 1, 0, 1010, 0, 0, 0, "マホマホ王国のプリンセス、\nまほ姫どす", "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 2, 0, 1.5, 1, 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("衣之咲 璃乃", "ここで会ったが\n100年目～！", 1, 0, 1011, 0, 0, 0, "衣之咲璃乃です！", "生き別れたお兄ちゃんを探して\n三千世界！", 2, 0, 1.4, 1, 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("柏崎 初音", "…って、お願い！\n誰にも言わないでおいて～！", 1, 0, 1012, 0, 0, 0, "私はハツネ、\n結構強いんだよ。\nきらーん☆", "ち、超能力って…\n何のことかな～？", 2, 0, 1.4, 1, 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("美波 鈴奈", "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1, 0, 1016, 0, 0, 0, "ちょす！\n美波鈴奈だよ～♪", "一応カリスマ読モJKやってまっす！", 2, 0, 1.4, 1, 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("喜屋武 香織", "でも、沖縄もとってもいいとこさー", 1, 0, 1017, 0, 0, 0, "はいたーい。\n喜屋武香織さー。", "東京は遊園地みたいなところさー", 2, 0, 1.4, 1, 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("支倉 伊緒", "イオちゃんって呼んでね。", 1, 0, 1018, 0, 0, 0, "支倉伊緒です。", "先生って呼ばれるのは\nくすぐったいから", 2, 0, 1.4, 1, 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("茜 ミミ", "ミミをおいてかないでぇ～", 1, 0, 1020, 0, 0, 0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", "あ！/\お兄ちゃ～ん\nまってよ～", 2, 0, 1.5, 1, 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("栗林 くるみ", "ふぇぇぇぇぇん……", 1, 0, 1021, 0, 0, 0, "あ…あの…えっと…\n栗…林…くるみ…です……", "あの……\nふぇ……", 2, 0, 1.5, 1, 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("風宮 より", "なんてありがとうございます！", 1, 0, 1022, 0, 0, 0, "風宮よりです。\nあああああ！", "こんな私に貴重な時間を\n割いていただき、", 2, 0, 1.4, 1, 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("北条 綾音", "私こっち行きたいー\nね、早く早くー", 1, 0, 1023, 0, 0, 0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", "おにいちゃんどこいくの？\nえ？", 2, 0, 1.5, 1, 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("天野 すずめ", "これて何か違う…\nあああすみません！", 1, 0, 1025, 0, 0, 0, "わっ…わっ…私、\n天野すずめといいます！", "ふ、不束者ですが\nどうぞ末永く…って、", 2, 0, 1.4, 1, 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("倉石 恵理子", "離しませんわ………\n絶対に…!!", 1, 0, 1027, 0, 0, 0, "……クスクス…私は\n…倉石恵理子……", "あなたは…運命の……\n伴侶……", 2, 0, 1.4, 1, 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("佐々木 咲恋", "…そうでしょ？？", 1, 0, 1028, 0, 0, 0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 2, 0, 1.4, 1, 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("桜井 望", "あはは、\n私もまだまだだなぁ～", 1, 0, 1029, 0, 0, 0, "桜井望だよ！\nよろしくねっ", "ぇっと…\nキミ、私のこと知らないの?!", 2, 0, 1.4, 1, 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("ニノン・ジュベール", "ショーグン、\nワタシと一緒に天下統一デース！", 1, 0, 1030, 0, 0, 0, "デケデケデンっ！", "初めまして、\n私はニノン・ジュベール申すデス！", 2, 0, 1.4, 1, 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("上喜 しのぶ", "おかしいですね……", 1, 0, 1031, 0, 0, 0, "上喜しのぶです。\n手元のドクロが父です。", "でもって私の隣にいるのが……\nえ、見えない？", 2, 0, 1.4, 1, 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("野戸まひる", "そう、\nオラのボケに突っ込める相方が…！", 1, 0, 1033, 0, 0, 0, "目指すはビッグな\nお笑い芸人だっぺ！", "けんども\nそれには足りないモンが…", 2, 0, 1.5, 1, 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("綾瀬 ゆかり", "ちょ\nちょっと一杯飲んできます…！", 1, 0, 1034, 0, 0, 0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", "ちょっと緊張しちゃって…", 2, 0, 1.4, 1, 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("氷川 鏡華", "これ以上お話しすることは…\nないです！", 1, 0, 1036, 0, 0, 0, "氷川鏡華…です", "知らない人とは話しちゃいけないので", 2, 0, 1.5, 1, 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("柏崎 栞", "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1, 0, 1038, 0, 0, 0, "柏崎…栞です。", "……あ、アラーム。", 2, 0, 1.4, 1, 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("双葉 碧", "野に咲く花が、\n唯一の話相手です。", 1, 0, 1040, 0, 0, 0, "ふ、双葉碧です。", "私、一人も友達がいなくて……", 2, 0, 1.4, 1, 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("三角 千歌", "そう思っています。", 1, 0, 1042, 0, 0, 0, "三角千歌です。", "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 2, 0, 1.4, 1, 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("安芸 真琴", "う、疑ってすまなかったな…", 1, 0, 1043, 0, 0, 0, "安芸真琴だ。", "あぁ？\nお前のそいつの仲間か？", 2, 0, 1.4, 1, 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("イリヤ・オーンスタイン", "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1, 0, 1044, 0, 0, 0, "わらわこそは夜を総べる者！", "生けとし生ける全ての者よ！", 2, 0, 1.4, 1, 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("遠見 空花", "ｌク、クウカに何かご用ですか!?", 1, 0, 1045, 0, 0, 0, "そこで騎士は妖精を乱暴に……", "ぐふふふふ……はっ！", 2, 0, 1.4, 1, 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("宮坂たまき", "う～ん…\n猫ってホントに最高にゃ～♪", 1, 0, 1046, 0, 0, 0, "宮坂たまきにゃ♪\n猫はいいにゃよ？", "自由気ままで♪\n寝て遊んで、食べてケンカして…", 2, 0, 1.4, 1, 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("大神 美冬", "…と思ったら\nバイトの時間だ！\nまたあとでね！", 1, 0, 1048, 0, 0, 0, "大神美冬よ！", "それでは早速クエストに…", 2, 0, 1.4, 1, 1);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("星野静流", "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1, 0, 1049, 0, 0, 0, "星野静流だよ！", "クエストもバトルも\n掃除も洗濯も", 2, 0, 1.4, 1, 1);
